import { useAlert } from 'react-alert'

export default class Reader extends Component {

    constructor(props) {
        super(props)
        this.state = {
            actual_button : this.props.data
        }
    }

    render() {

        return(
            <div >
                <Text > Pressed button: {this.state.actual_button} </Text>
            </div>
        )
    }
}
